import React from 'react';
import {Link, withRouter} from 'react-router-dom';

import './Navbar.css';

function Navbar() {
    return (
        <div className='Navbar'>
            <Link to="/">Task 1</Link>
            <Link to="/">Task 2</Link>
        </div>
    );
}

export default withRouter(Navbar);
